  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kodiak
  NWR outlines Refuge accomplishments during the 1964 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, collections and receipts, and wildfires. Resource management
  is outlined; topics include fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
  and safety. Photographs, N-R forms, and field guides are attached.\",\n\t\"owner_org\":
